    $(function() {
		    tab=$("#slide").KandyTabs({
		    del:true,
		    scroll:true,
		    trigger:'click',
		    custom:function(b,c,i){
				$("p",c).fadeOut();
				c.eq(i).find("p").slideDown(1500);
				index=i;
			},
		    done: function(btn,cont,tab){
		    	$("#slide .tabbtn").each(function(i)
		    	{
		    	if($(this).text().indexOf("我的桌面")>-1)//如果当前选项卡是我的桌面
